import React, {Component} from 'react';
import './Custom.css'
import { auth, createUserDocument } from '../../firebase';
import Shoenique from '../../Shoenique'
import {Link} from 'react-router-dom'
import shoenw from '../img/shoenw.png'


class Custom2 extends Component {

    logout = () => {
        auth.signOut();
    }

    render(){
        return(
            <>
            <div className="navbar">
            <img src={shoenw} className="logo" />
            <ul>
                <li className=''>
                </li>
                <li className=''>
                    
                </li>
                <li className=''>
                
                </li>
                <li className=''>
                    <button onClick={this.logout}>Logout</button>
                </li>
            </ul> 
            </div>
            <button className="next-to-payment" type="button"><span></span>
                <Link to='/payment' className='custom-butt'> Next to Payment </Link>
            </button>
            
            < Shoenique />
        
            </>
        )
    }
}

export default Custom2;
